#include "libft_test.h"

static void test_ft_strcat_one(char *s1, char *s2, int *current, int total) {
	
	*current += 1;

	char *dst_ft = (char *)malloc(sizeof(char) * (strlen(s1) + strlen(s2) + 1));
	char *dst_org = (char *)malloc(sizeof(char) * (strlen(s1) + strlen(s2) + 1));
	strcpy(dst_org, s1);
	strcpy(dst_ft, s1);
	char *ft_ret = ft_strcat(dst_ft, s2);
	char *org_ret = strcat(dst_org, s2);
	assert(!strcmp(org_ret, ft_ret));
	free(org_ret);
	free(ft_ret);
	STATUS(*current, total);
}


#ifdef SPEEDTEST
static void test_ft_strcat_speed(size_t mem_size, size_t n_iter)
{
	CATEGORY("ft_strcat performance");
	printf("memory size = %zu bytes\n", mem_size);
	printf("number of iterations = %zu\n", n_iter);

	size_t len = mem_size;
	size_t iter = n_iter;

	clock_t start = 0;

	// setup test string
	char *sample = "andjkasb azoxkczkcmzlxkczm zxcn iu bhq uaao bkjcbcz1534 z83x4zx8c4 c1zx184 asda123465";
	size_t sample_len = strlen(sample);

	char *s1 = (char *)malloc(sizeof(char) * len);

	size_t ttl_len = 0;
	while (ttl_len < len) {
		size_t cpy_len = sample_len;
		if (ttl_len + sample_len > len) {
			cpy_len = len - ttl_len;
		}
		memcpy(s1 + ttl_len, sample, cpy_len);
		ttl_len += cpy_len;
	}

	s1[len - 1] = 0;

	size_t ret_len = len* 2;
	char *ret = (char *)malloc(sizeof(char) * (ret_len + 1));
	bzero(ret, ret_len);
	strcpy(ret, s1);

	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		bzero(ret, ret_len);
		strcpy(ret, s1);
		strcat(ret, s1);
	}
	clock_t end = clock();
	double ft_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / ft_time, "strcat");
	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		bzero(ret, ret_len);
		strcpy(ret, s1);
		ft_strcat(ret, s1);
	}
	end = clock();
	double new_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / new_time, "ft_strcat");
	SPEEDCMP((ft_time / new_time) * 100, "strcat");
	free(s1);
	free(ret);
}
#endif // SPEEDTEST

